import React, { Component } from 'react'
import {CardElement,
    injectStripe,
    Elements,
    StripeProvider } from "@stripe/react-stripe-js";
import { loadStripe } from "@stripe/stripe-js";


 class Checkout extends Component {
    submit(e){
        e.preventDefault()
    }
    render() {
        return (
            <StripeProvider>
                <Elements>
                <div className='checkout'>
                <CardElement></CardElement>
                <button onClick={this.submit()}> paye</button>
            </div>
                </Elements>
            </StripeProvider>
            
        )
    }
}
export default injectStripe(Checkout)
